/*eslint-disable*/
import React from "react";
// reactstrap components
import { Container, Row, Nav, NavItem, NavLink, Col, Button, Badge } from "reactstrap";
import classnames from "classnames";

class ServiceBooking extends React.Component {

    state = {
        iconTabs: 1,
        plainTabs: 1
      };
      toggleNavs = (e, state, index) => {
        e.preventDefault();
        this.setState({
          [state]: index
        });
      };
  render() {

    return (
        <div className="content">
                      <section className="section section-lg">
            <Container>
              <Row className="row-grid align-items-center">
                <Col className="order-md-1" md="12">
                  <div className="pr-md-5">
                    <h1>To book a service at the venue</h1>

                 </div>
                 </Col>
                </Row>
                <Row>
                <Col className="order-md-1" md="8">
                <p>
                    In three simple steps, book an appointment at a salon <br />or spa of your choice!
                    </p>
                    </Col>
                 <Col className="order-md-2" md="4">
                 <div >
              <Nav
                className="nav-fill flex-column flex-md-row"
                id="tabs-icons-text"
                pills
                role="tablist"
              >
                <NavItem>
                  <NavLink
                    aria-selected={this.state.iconTabs === 1}
                    className={classnames("mb-sm-3 mb-md-0", {
                      active: this.state.iconTabs === 1
                    })}
                    onClick={e => this.toggleNavs(e, "iconTabs", 1)}
                    href="#pablo"
                    role="tab"
                  >
                    <i className="ni ni-cloud-upload-96 mr-2" />
                    Home
                  </NavLink>
                </NavItem>

                <NavItem>
                  <NavLink
                    aria-selected={this.state.iconTabs === 3}
                    className={classnames("mb-sm-3 mb-md-0", {
                      active: this.state.iconTabs === 3
                    })}
                    onClick={e => this.toggleNavs(e, "iconTabs", 3)}
                    href="#pablo"
                    role="tab"
                  >
                    <i className="ni ni-calendar-grid-58 mr-2" />
                    Messages
                  </NavLink>
                </NavItem>
                <div class="icons-block d-flex">
            <div class="icon position-relative">
              <span><i class="fa fa-angle-left"></i></span>
            </div>
            <div class="icon position-relative">
              <span><i class="fa fa-angle-right"></i></span>
            </div>
          </div>
              </Nav>

            </div>

                </Col>
              </Row>
              <hr />
            </Container>
          </section>
            </div>
    );
  }
}

export default ServiceBooking;
